DROP TABLE IF EXISTS `shop`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `shop` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `shop_name` varchar(255) NOT NULL,
  `shop_account_type` varchar(255) DEFAULT NULL,
  `approval_date` datetime DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `note` varchar(255) DEFAULT NULL,
  `landland` varchar(255) DEFAULT NULL,
  `mobile` varchar(255) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `shop_logo` longblob,
  `shop_logo_content_type` varchar(255) DEFAULT NULL,
  `shop_logo_url` varchar(255) DEFAULT NULL,
  `active` bit(1) DEFAULT NULL,
  `currency` varchar(255) DEFAULT NULL,
  `company_id` bigint(20) DEFAULT NULL,
  `approved_by_id` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_shop_company_id` (`company_id`),
  KEY `fk_shop_approved_by_id` (`approved_by_id`),
  CONSTRAINT `fk_shop_approved_by_id` FOREIGN KEY (`approved_by_id`) REFERENCES `profile` (`id`),
  CONSTRAINT `fk_shop_company_id` FOREIGN KEY (`company_id`) REFERENCES `company` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;
